import style from './App.module.css'

function App () {
  const [characters, setCharacters] = useState([]);
  return (
    <div className='App' style={{ padding: '25px' }}>
      
       <Nav/>
        <Cards characters={characters}/>
      
    </div>
  )
}

export default App;
